import React, { useEffect, useState } from 'react'
import axios from "axios"
export default function EmployeeLaw() {

    const [data, setData] = useState([{ id,nationalID:"",servicetype: "",adtex:"", appointment:"" }]);
    useEffect(() => {
        axios.get("api/serv")
            .then(result => setData(result.data));
        console.log(data);
    }, []);
    // const deleteProposal = (data) => {
    //     console.log('delete Car');
    //     return axios.delete(`delete/${data.carId}`);
    //   };
    return (
        <div>
            <h1> List Of Cars : </h1>
            <hr />
            {data.map(HearingImpaireds => {
                return <div key={HearingImpaireds.nationalID}>
                     <h2>{HearingImpaireds.servicetype}</h2>
                    <h2>{HearingImpaireds.adtex}</h2>
                    <p>{HearingImpaireds.appointment}</p>
                    {/* <button onClick={deleteProposal}>delete</button> */}
                    <hr/>
                </div>
            })}
        </div>
    )
}
